[3,0]	Name	"+1 Jerkin"
[4,0]	Name	"+1 Knife"
[2,0]	Name	"Blob"
[7,0]	Nutrition	750
[5,0]	Player	{}
[6,0]	ProvidesHealing	{"heal_amount":15}
[7,0]	RenderOnFloor	null
[6,0]	RenderOnFloor	null
[5,0]	RenderOnMap	null
[2,0]	RenderOnMap	null
[6,0]	Renderable	{"sym":"HealthPotion","fg":{"r":255,"g":0,"b":255},"bg":{"r":0,"g":0,"b":0}}
[7,0]	Renderable	{"sym":"Ration","fg":{"r":191,"g":92,"b":0},"bg":{"r":0,"g":0,"b":0}}
[5,0]	Renderable	{"sym":"Player","fg":{"r":255,"g":255,"b":0},"bg":{"r":0,"g":0,"b":0}}
[3,0]	Renderable	{"sym":"Jerkin","fg":{"r":170,"g":97,"b":32},"bg":{"r":0,"g":0,"b":0}}
[4,0]	Renderable	{"sym":"Knife","fg":{"r":165,"g":165,"b":165},"bg":{"r":0,"g":0,"b":0}}
[2,0]	Renderable	{"sym":"Blob","fg":{"r":89,"g":162,"b":191},"bg":{"r":0,"g":0,"b":0}}
[5,0]	Stomach	{"fullness":1491,"max_fullness":1500,"sub_hp":0}
[5,0]	Tally	{"damage_dealt":0,"damage_taken":0,"kills":0} If you have a native build of RuggRogue, you can copy and paste this into a file named savegame.txt and the game will load it. The above save data contains the player, a monster and some items confined in a small enclosed room in the center of the map. We can break down this example save data, starting with the top lines: *	GameSeed	9542716676452101438
*	TurnCount	10
*	Wins	0
*	BaseEquipmentLevel	0
*	Difficulty	{"id":[8,0],"exp_for_next_depth":40}
*	Messages	{"capacity":100,"msg_queue":["This is a test save!"],"num_highlighted":0}
*	PlayerAlive	true
*	PlayerId	[5,0]
*	Map	{"depth":1,"width":80,"height":50,"tiles":[["W",1952],["F",8],["W",72],["F",8],["W",72],["F",8],["W",72],["F",8],["W",72],["F",8],["W",72],["F",8],["W",72],["F",8],["W",72],["F",8],["W",1760]],"rooms":[{"x1":32,"y1":24,"x2":39,"y2":31}],"seen":{"width":80,"height":50,"bv":[[1,4000]]}} All of these lines represent uniques, since they all start with an asterisk character. There's some basic data for uniques such as GameSeed, TurnCount, Wins and PlayerAlive whose data should hopefully be self-explanatory. Looking at some of the other lines reveals that all data is serialized in JSON format. The line for the Map unique is interesting here. The "tiles" field stores the contents of each tile in the map: "W" is a wall, "F" is a floor and "D" would be a downstairs tile that isn't featured in this tile data. Tiles have a lot of redundancy, so they're stored in a special compressed form that will be covered later in this chapter. Even with compression, this Map line will often be a lot longer than this in a typical save file. You may have noticed the pairs of numbers present in the lines for the Difficulty and the PlayerId uniques. These are entity IDs, so each pair uniquely identifies a entity. Here, the difficulty tracker is represented by the [8,0] entity, while the player is represented by the [5,0] entity. We can peek at the component data for the difficulty tracker by singling out lines of component data starting with the [8,0] entity ID, of which there is just one: [8,0]	Experience	{"level":1,"exp":0,"next":50,"base":0} As we can see, the difficulty tracking entity has a single Experience component that is at level 1 and will advance to the next level once it gains 50 experience points. Filtering for the player by looking at lines starting with [5,0] shows that they hold a lot more data: [5,0]	CombatStats	{"max_hp":40,"hp":40,"attack":4.8,"defense":2.4}
[5,0]	Coord	{"x":33,"y":25}
[5,0]	Equipment	{"weapon":[4,0],"armor":[3,0]}
[5,0]	Experience	{"level":1,"exp":0,"next":50,"base":0}
[5,0]	FieldOfView	{"tiles":{"width":17,"height":17,"bv":[[0,108],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,9],[0,8],[1,9],[0,8],[1,7],[0,21]]},"range":8,"center":[33,25],"dirty":false}
[5,0]	Inventory	{"items":[]}
[5,0]	Name	"Player"
[5,0]	Player	{}
[5,0]	RenderOnMap	null
[5,0]	Renderable	{"sym":"Player","fg":{"r":255,"g":255,"b":0},"bg":{"r":0,"g":0,"b":0}}
[5,0]	Stomach	{"fullness":1491,"max_fullness":1500,"sub_hp":0}
[5,0]	Tally	{"damage_dealt":0,"damage_taken":0,"kills":0} The player's CombatStats show that they're at 40 out of 40 hit points, with a base attack value of 4.8 and a base defense value of 2.4. According to the Coord component they are located at coordinates 33,25. Like the difficulty tracker, the player has an Experience component. Components such as Name, Renderable, Stomach and Tally contain basic data. The RenderOnMap component is a tag component with no data, so its serialized to the JSON null value. The Player component would be saved the same way, except it stores some runtime data that doesn't need to be saved, so it comes out as an empty JSON object instead. The FieldOfView component represents which tiles in the immediate vicinity of the player should be visible. It's a very long line out of necessity since each line must hold the full data of either a unique or a component. The "bv" field within the top-level "tiles" field is compressed in the same way as the tiles of the map unique. The Equipment and Inventory components typically contain entity IDs. Here, the player's inventory is empty, but they are armed with a weapon and armor. Here are the lines for the weapon entity, which is a "+1 Knife": [4,0]	CombatBonus	{"attack":3.2,"defense":0.0}
[4,0]	EquipSlot	"Weapon"
[4,0]	Item	null
[4,0]	Name	"+1 Knife"
[4,0]	Renderable	{"sym":"Knife","fg":{"r":165,"g":165,"b":165},"bg":{"r":0,"g":0,"b":0}} The player's armor is a "+1 Jerkin": [3,0]	CombatBonus	{"attack":0.0,"defense":1.4}
[3,0]	EquipSlot	"Armor"
[3,0]	Item	null
[3,0]	Name	"+1 Jerkin"
[3,0]	Renderable	{"sym":"Jerkin","fg":{"r":170,"g":97,"b":32},"bg":{"r":0,"g":0,"b":0}} There's a "Health Potion" that's on the floor at coordinates 38,25: [6,0]	Consumable	null
[6,0]	Coord	{"x":38,"y":25}
[6,0]	Item	null
[6,0]	Name	"Health Potion"
[6,0]	ProvidesHealing	{"heal_amount":15}
[6,0]	RenderOnFloor	null
[6,0]	Renderable	{"sym":"HealthPotion","fg":{"r":255,"g":0,"b":255},"bg":{"r":0,"g":0,"b":0}} Finally, there's an enemy "Blob" in the opposite corner of the room to the player: [2,0]	BlocksTile	null
[2,0]	CombatStats	{"max_hp":14,"hp":14,"attack":8.0,"defense":4.0}
[2,0]	Coord	{"x":38,"y":30}
[2,0]	Experience	{"level":1,"exp":0,"next":0,"base":0}
[2,0]	FieldOfView	{"tiles":{"width":17,"height":17,"bv":[[0,21],[1,7],[0,8],[1,9],[0,8],[1,9],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,7],[1,10],[0,108]]},"range":8,"center":[38,30],"dirty":false}
[2,0]	GivesExperience	10
[2,0]	Monster	null
[2,0]	Name	"Blob"
[2,0]	RenderOnMap	null
[2,0]	Renderable	{"sym":"Blob","fg":{"r":89,"g":162,"b":191},"bg":{"r":0,"g":0,"b":0}} Monsters share a lot of common component types with the player, but they have a Monster tag component instead of a Player component. The BlocksTile tag component marks that other monsters should take a path around this monster, rather than trying to go through it. And that's it: a full run-down of a complete save file. The format is pretty flexible: lines can technically occur in any order so long as every unique type is present. Save data is considered valid as long as all entity IDs exist, and the existence of entities is implied by the ID values at the start of component lines.

123.body:
The loading of the save data proper is handled by the load_save_file function. The top half of this function is dedicated to setting up for and loading the data out of the save file, one line at a time. We can think of loaded data as transitioning through two phases: temporary and committed. As the save file is processed a line at a time, data is loaded in some temporary form. Once we're happy that everything was loaded successfully, we can take the temporary data and convert it into its committed form; the form that the rest of the game will see and deal with. Loading a Unique Line The big loop near the beginning of the load_save_file function is what reads in each line of the save file. Just before it are a bunch of lines that look like this: let mut game_seed: Option<GameSeed> = None;
let mut turn_count: Option<TurnCount> = None;
let mut wins: Option<Wins> = None;
let mut base_equipment_level: Option<BaseEquipmentLevel> = None;
let mut difficulty: Option<Difficulty> = None;
let mut messages: Option<Messages> = None;
let mut player_alive: Option<PlayerAlive> = None;
let mut player_id: Option<PlayerId> = None;
let mut map: Option<Map> = None; These are all temporary variables for unique data. When the per-line loop reads in a unique, it fills one of these with a Some variant containing the loaded data for that unique. The first conditional block of the per-line loop checks for an asterisk character and a whitespace. If those characters are detected, the line is trimmed to the point after them and the loading process will attempt to interpret the line according to all of the unique types it knows of, one at a time. Unique lines are loaded via the deserialize_named_unique function, which has a helper deserialize_unique! macro to reduce typing redundancy. The deserialize_named_unique function accepts one of the temporary variables for holding unique data. It does one of the following things, depending on the contents of the data line it sees: Returns Ok(false) if the unique type name doesn't match what was expected. Returns Ok(false) if deserializing failed for whatever reason. Returns Err(LoadError::DuplicateUnique(...)) if the temporary variable was already filled in and the load would otherwise have succeeded. Returns Ok(true) and fills in the temporary variable with the loaded data if none of the above occurred. In other words, a return value of Ok(true) means the unique data was successfully loaded, while Ok(false) indicates that other unique types should be attempted. Loading a Component Line When components are loaded in, they need to be attached to newly-created entities. These entities share the same world space as any entities that existed before the loading process started. When entities are created during the loading process they're added to the despawn_ids vector passed into the load_save_file function. As mentioned before, entities in this vector will eventually be despawned if they're still there when the load_save_file function is done. Therefore, we can think of components loaded and attached to these entities as temporary storage. With that in mind, we can now consider lines that should contain component data. The loading process will try to interpret any line that doesn't start with an asterisk character as a component line instead. The first part of a component line is the entity that the component should be attached to. This entity ID is meaningful within the save data, but is meaningless in the current world. To reconcile this, we need to map each distinct entity ID that we encounter while loading components to fresh entities that have their own new entity IDs. Near the top of the load_save_file function is the data structure whose job is to manage exactly this: let mut old_to_new_ids: HashMap<EntityId, EntityId> = HashMap::new(); The keys of this hash map are the entity IDs as listed in the save file, while the values are the entity IDs of the corresponding fresh new entities that represent them in their real, loaded form. If the entity ID at the beginning of the component line exists, it is simply retrieved. If it doesn't, it is created and added to this hash map. Since we have the ID of the new entity, we can proceed to attempt to load components, trying one type at a time. This is done with the deserialize_named_component function and the deserialize_component! helper macro that work much like how deserialize_named_unique and deserialize_unique! did for uniques. In fact, the deserialize_named_component function works the same way as the deserialize_named_unique function, except that it attaches component data to a new temporary entity passed in by ID and emits Err(LoadError::DuplicateComponent(...)) instead. At this point, any line that cannot be read as data for a unique or for a component causes the load_save_file function to return LoadError::UnrecoginzedLine as an error.

124.body:
Once every line in the save file has been processed, we need to check that every unique is accounted for. The code is short enough to show here in its entirety: // Check that all uniques are present.
let game_seed = game_seed.ok_or(LoadError::MissingUnique("GameSeed"))?;
let turn_count = turn_count.ok_or(LoadError::MissingUnique("TurnCount"))?;
let wins = wins.ok_or(LoadError::MissingUnique("Wins"))?;
let base_equipment_level = base_equipment_level.ok_or(LoadError::MissingUnique("BaseEquipmentLevel"))?;
let mut difficulty = difficulty.ok_or(LoadError::MissingUnique("Difficulty"))?;
let messages = messages.ok_or(LoadError::MissingUnique("Messages"))?;
let player_alive = player_alive.ok_or(LoadError::MissingUnique("PlayerAlive"))?;
let mut player_id = player_id.ok_or(LoadError::MissingUnique("PlayerId"))?;
let mut map = map.ok_or(LoadError::MissingUnique("Map"))?; The above code checks that each unique type was loaded, and bails with an error if any of them are missing. It also uses shadowing to redefine the temporary unique variables into non-Option form so they're easier to work with later in the loading code.

129.body:
If you've been reading up to this point, you might have noticed that something is missing in this explanation: how is serialization and deserialization actually performed? If each line of the save file ends with JSON-formatted data, how are data structures converted to and from JSON when saving and loading? The reason that all of this has been glossed over is because RuggRogue outsources the task to two crates: serde and serde_json , that make it almost trivial. RuggRogue first uses Serde to annotate any data structure that needs this treatment using the derive macros that provides, like so: use serde::{Deserialize, Serialize}; #[derive(Deserialize, Serialize)]
pub struct GameSeed(u64); In the above example, GameSeed is a simple tuple struct, but this annotation works for larger structs with fields and enums as well. Every data structure that RuggRogue needs to save into the save file is annotated in this way. Once annotated like this, these data structures can then be serialized into JSON format using serde_json, e.g.: // NOTE: Not real saving code! use serde_json::Serializer; let mut writer = SomethingToWriteInto::new();
let game_seed = world.borrow::<UniqueView<GameSeed>>();
game_seed.serialize(&mut Serializer::new(&mut writer))?; Deserialization from JSON is also handled by serde_json: // NOTE: Not real loading code! use serde_json::Deserializer; let line = GetALineFromSomewhere::new();
let mut ds = Deserializer::from_str(line);
let mut game_seed = GameSeed::deserialize(&mut ds)?;
world.borrow::<UniqueViewMut<GameSeed>>().0 = game_seed.0; The above code samples aren't real code, but they're rough approximations of what happens inside the serialize_named_unique, serialize_named_storage, deserialize_named_unique and deserialize_named_storage functions. For simple data, this is all that is needed for serialization and deserialization. However, let's take a look at the definition of the Map struct in the src/map.rs file, paying attention to the annotations: #[derive(Deserialize, Serialize)]
pub struct Map { pub depth: i32, pub width: i32, pub height: i32, #[serde(with = "crate::saveload::run_length_encoded")] tiles: Vec<Tile>, pub rooms: Vec<Rect>, pub seen: BitGrid, // (x, y) -> (blocking_entity_count, entities_here) #[serde(skip)] tile_entities: HashMap<(i32, i32), (i32, Vec<EntityId>)>, // zero-length non-zero-capacity vectors for reuse in tile_entities #[serde(skip)] empty_entity_vecs: Vec<Vec<EntityId>>,
} Note the "crate::saveload::run_length_encoded" annotation on the tiles field. This is how RuggRogue tells Serde that it wants to save the tiles field differently than how it normally would. In this case, we know that there would be a lot of redundancy when saving the tile data of the map, so to cut it down we want to handle this field specially. The way we want to cut down the size of the tile data that we save is by run-length encoding it. Instead of writing each tile individually, we want to write the tile followed by the number of repetitions until a different tile appears. This has a pretty dramatic impact on save file size: basic tests show that it reduces save file size by about two-thirds! The "crate::saveload::run_length_encoded" bit refers to the run_length_encoded module near the bottom of the src/saveload.rs file. The serialize function contained within just reads in tiles and tracks runs of repeated tiles into a temporary vector, and just serializes that vector. Conversely, the deserialize function reads in the vector in that format and uses some Rust iterator functions to convert it back into a normal vector of tiles that the Map struct actually wants. For the tiles of a map, that's all that we need to perform run-length encoding. However, we also want to apply run-length encoding to things like our fields of view, specifically to the bv field of our homegrown BitGrid struct in the src/bitgrid.rs file: /// A width-by-height-sized BitVec for convenient handling of a grid of boolean values.
#[derive(Deserialize, Serialize)]
pub struct BitGrid { width: i32, height: i32, #[serde(with = "crate::saveload::bit_vec")] bv: BitVec,
} We have a BitVec here which is notably not Rust's standard Vec type that the run_length_encoded module wants. The "crate::saveload::bit_vec" bit refers to the bit_vec module at the very bottom of the src/saveload.rs file. The only job of this module is to convert the BitVec to and from a standard Rust Vec<u8> of ones and zeroes and then hand it off to the run_length_encoded module to apply its run-length encoding. The end result is run-length encoding for BitVec fields that decreases the amount of space needed to save them. A final note: apparently the BitVec type can be processed by Serde with an internal representation that's even more compact than the roundabout run-length encoding that RuggRogue uses. However, the documentation of that crate warns that its output isn't guaranteed to stay stable. What's more, even trying to use it as-is resulted in serialized output that the deserializer would choke on. In a sense, the run-length encoding that RuggRogue uses is actually a workaround for the BitVec type not serializing and deserializing correctly to begin with.

141.body:
The most important part of the field of view story starts in the recalculate_fields_of_view function in the src/vision.rs file, and the most important part of that is reproduced below: // Update field of view.
for (x, y, symmetric) in ruggrogue::field_of_view(&*map, coord.0.into(), fov.range, FovShape::CirclePlus)
{ if symmetric || matches!(map.get_tile(x, y), &Tile::Wall) { fov.set((x, y), true); }
} The ruggrogue::field_of_view function returns the iterator that implements shadow casting. That iterator is initialized with the map and center starting tile, but you'll also notice the "range" and "shape" being given as well. Vision is calculated up to a maximum range given in tiles. The "shape" of a field of view determines how that range is treated: FovShape::CirclePlus effectively asks for a circle with a radius of that range plus half a tile. Adding half a tile prevents single tiles poking out on the four cardinal directions that would occur with an exact radius circle of vision. The iterator returns the map coordinates of visible tiles, along with a symmetric flag if the tile is considered symmetrically visible, i.e. its center point is visible to the center of the starting tile. The body of the loop then makes the final decision about whether that tile is visible: a symmetrically visible tile is always visible, and walls are visible regardless of symmetry. The ruggrogue::field_of_view function itself lives at the bottom of the src/lib/field_of_view.rs file. It does nothing more than initialize an instance of the FovIter struct whose definition can be found near the top of the file. The first interesting thing about the FovIter struct is the map that it takes. The map it wants needs to adhere to two traits: the BoundedMap trait (defined in src/lib/lib.rs) that allows the upcoming logic to query the bounds of the map to avoid out-of-bounds access, and the ViewableField trait to check if a given coordinate blocks vision. The other thing to note about the FovIter struct is that it holds a lot of book-keeping data aside from its initial parameters. We can break down the fields into three groups: Initial data map: The map to calculate the field of view over. start_pos: The map coordinates of the center starting tile to calculate the field of view from. range: The maximum range of the field of view, in tiles. fov_shape: The shape that the field of view should take: the game only uses FovShape::CirclePlus as described earlier. Temporary data bounds: Cached map bounds describing the inclusive range of valid coordinates of the map. max_dist2: Maximum distance squared, derived from range and used as part of distance checking in order to shape the field of view. sights_even and sights_odd: Even and odd sight lists described in the shadow casting algorithm section earlier. low_y and high_y: Range of y values for the current sight being processed. low_sight_angle: The working slope that holds the slope of the first floor tile as described in the shadow casting algorithm section earlier. Iteration progress octant: The current octant being processed; None means we're just getting started, while Some(8) means that the iterator is finished. x: The column being processed within an octant: None means the octant was just entered. s: The index into the current sight list within the column. y: The y value of the tile being processed within the sight, ranging from low_y to high_y inclusive. To fully appreciate why all of this data needs to be tracked in the FovIter struct and not, say, in variables in a function with nested loops, we need to dive into what happens after initialization.

143.body:
The entire shadow casting algorithm implementation used by RuggRogue is housed in the FovIter::advance function that makes up the largest part of the src/lib/field_of_view.rs file. There's a lot going in here, but if you've read through the shadow casting algorithm section earlier in the chapter you'll be equipped to understand it. By far the most unusual thing about this function is that despite the multiple octants, columns, sights and tiles that need to be handled, there is not a single loop in the whole function. This comes back to the fact that this is all one big iterator: it gets called once, does some work and produces an output, gets called again and does some more work. This is why the FovIter struct housed so much temporary and iteration progress data: to remember where to pick up from after returning a single tile's worth of data. The FovIter::advance function begins by declaring and initializing two variables: out_pos and out_symmetric, for the tile position and symmetry test to output respectively. Setting these variables signals that the function should return their values after this iteration. Leaving them be instead causes nothing to be returned, in turn causing the function to be called again immediately if the iteration hasn't finished yet. The very first call to FovIter::advance sets the octant field to Some(value) where the value is the octant index of -1 to visit the starting tile, 0 through 7 for each of the octants, or 8 when shadow casting is complete. The first level of if branches performs the logic for each of these cases. Visiting the starting tile when octant is -1 provides the simplest example of how FovIter produces output while setting up for its next iteration. Setting out_pos and out_symmetric causes these values to be returned by that iteration, while setting octant to Some(octant + 1) sets up the next iteration to resume processing in the very first octant. When processing an octant the very first step is to prepare the even and odd lists. This case is detected when the x (column) field is set to None: the odd list is cleared and set to a single sight covering the whole octant, i.e. low slope of 0/1 and high slope of 1/1. The x field is then set to Some(1) where 1 is the index of the first column in the octant, which prevents this logic from running again until we need it. The logic for processing a single column is gated with a check on if x <= self.range. One of the first things done in this branch is this: // Flip between using even and odd sights for current and next.
let (current, next) = if x % 2 == 0 { (&mut self.sights_even, &mut self.sights_odd)
} else { (&mut self.sights_odd, &mut self.sights_even)
}; If x is even, the current sight list is set to sights_odd and the role of the next sight list is given to sights_even; the lists are swapped when x is odd. This gets us to the point where we need to loop over sights in the current sight list. The index into this sight list is the s field which was previously initialized to None. If s is None at this point we need to prepare the next sight list to be filled in by clearing it and setting s to Some(0) where 0 is represents the first entry in the current sight list. If s is a valid index into the current sight list (i.e. s < current.len()), then we need to process the sight. This starts by checking if y is None: in that case the low_y and high_y for the sight need to be calculated, low_sight_angle (i.e. the working slope) needs to be initialized to None and y needs to be be initialized to Some(low_y) to kick off iteration of potentially visible tiles in the sight. There's a quick range and shape test to see if the tile being tested lies within the desired range; assuming it does, there's a bunch of things that need to be set up to deal with individual tiles: real_x and real_y are calculated with the help of the octant coefficients, depending on which octant is being processed. low_mid_angle is assembled, representing the slope of the mid-point of the bottom edge of the tile. An in_bounds callback is defined to avoid indexing coordinates outside of the map bounds. An angle_lt_or_eq callback is defined to compare slopes. The next conditional block that checks self.map.is_opaque(...) is responsible for detecting runs of floor tiles and adding them as sights to the next sight list when those runs end. If the tile is a wall and low_sight_angle is Some(...) value, a sight is added to the next sight list and low_sight_angle is reset to None. On the other hand, if the tile isn't a wall and low_sight_angle is None, low_sight_angle is set to either low_mid_angle or the low slope of the sight, whichever is higher; we need this check to ensure that we're never expanding sights in a way that doesn't make sense. With sight management out of the way we can finally visit the tile. As mentioned earlier, this involves setting the out_pos and out_symmetric variables, but there's a catch to this. First, we need to ensure that the tile is within the map bounds; we don't want to return out-of-bounds coordinates. Second, remember those shared edges between octants? This is the point where we check for that. We don't have to worry if y is strictly between 0 and x, but those exact values are the shared edge tiles. We only want to visit those if we're in octants that set the include_edges flag, which you may have noticed was part of the octant data amongst the hard-coded coefficients. This include_edges flag is set for octants 0, 3, 4 and 7, so the shared edge tiles will be visited in these octants and skipped in the others. Tile visitation is concluded by incrementing y. When y ticks past the high_y set for the current sight, it needs to wrap up with a final sight if low_sight_angle is still set to Some(...) value at this point. Other than that, s is incremented to move onto the next sight in the current sight list, and y is reset to None to invoke the start-of-sight logic the next time it's called. Beneath that is the case where s has iterated through all of the sights in the current sight list, meaning that the whole column has been processed. The x value is incremented to move onto the next column, while s is reset to None. The final else block under that is when every column of the octant has been processed. The iterator moves onto the next octant by incrementing the octant field and resetting x to None. When the octant field takes on the Some(8) value, shadow casting is complete and the field of view has been fully calculated!

