RuggRogue uses the A* search algorithm to find a path from a monster to the player. This path has two main concerns: Don't walk through walls. Don't walk through other monsters. The Map struct (defined in src/map.rs) implements the ruggrogue::PathableMap trait (defined in src/lib/path_find.rs) to tell the pathfinding code about these two things. The implementation itself can be found in the lower half of the src/map.rs file, and looks like this: impl ruggrogue::PathableMap for Map { fn is_blocked(&self, x: i32, y: i32) -> bool { matches!(self.get_tile(x, y), &Tile::Wall) || self .tile_entities .get(&(x, y)) .map_or(false, |(block_count, _)| *block_count > 0) }
} The wall check should be self-explanatory, but the part concerning entities warrants some explanation. The position of all entities placed on the map is stored in their Coord component, but it's also redundantly stored in the tile_entities field of the Map struct, which is the spatial entity cache : pub struct Map { // ... // (x, y) -> (blocking_entity_count, entities_here) #[serde(skip)] tile_entities: HashMap<(i32, i32), (i32, Vec<EntityId>)>, // ...
} The keys of the tile_entities hash map are map positions. The value is made up of two parts: a count and a list of entities present at that map position. As you might have guessed from the comment in the code above, the count tracks the number of entities in the list that block pathfinding. All entities that block pathfinding are marked with a BlocksTile component, and every monster is spawned with this component in the spawn_monster function in the src/spawn.rs file. The maintenance of the spatial entity cache is managed by three functions associated with the Map struct: Map::place_entity Map::remove_entity Map::move_entity These functions are called in numerous places for all entities, such as when starting or loading a game, player movement, and picking up and dropping of items. They are especially important when called for monsters in order to update the blocking entity count of tile positions in the spatial entity cache when they move or are spawned or despawned. Based on all of this, the is_blocked function from earlier can therefore determine if a tile contains a blocking entity by simply checking the spatial entity cache for a non-zero blocking entity count, saving it from having to scan the whole entity list for entities with a BlocksTile component.

