When the monster AI wants to find a path to the player, it requests it by calling the ruggrogue::find_path function defined in the src/lib/path_find.rs file. This function returns its result as an instance of the AStarIter struct, which is an iterator that yields each step in the path that it finds from the starting position to the destination. The first thing the ruggrogue::find_path function does is prepare a hash map for the back-end a_star function to fill in with raw pathfinding data: let mut came_from: HashMap<(i32, i32), (i32, i32)> = HashMap::new(); The key of this hash map is a tile position, while the value is the position of the pathfinding step taken to get to this tile. Following this linkage of steps from any keyed position will eventually lead back to the starting position. In other words, the path data that will be stored in here will be backwards; that will be dealt with later. The ruggrogue::find_path function calls the a_star function defined above it to perform the pathfinding itself: let closest = a_star(map, start, dest, bound_pad, &mut came_from); The first thing to note is the bound_pad argument. In order to avoid excessive path exploration when no path exists between a monster and the player, pathfinding in RuggRogue is not typically performed over the entire map. Instead, pathfinding is bounded by a rectangle of tiles that includes the monster and player positions as corners. If the bound_pad argument is non-zero, this rectangle is expanded to include bound_pad-worth of extra tiles on all sides; a zero bound_pad causes pathfinding to explore the whole map if needed. The call to the a_star function populates the came_from hash map, but it also returns the position of the tile closest to the destination out of all the tiles that it explored. If a path is found to the destination, this closest tile will be the destination itself. If there is no such path, the caller of ruggrogue::find_path can opt into receiving a path to this closest tile instead by setting the fallback_closest argument to true; monster AI uses this to allow multiple monsters to pursue the player down a single-tile-wide corridor for example. As mentioned earlier, the raw path data in the came_from hash map has each tile point backwards to the tile it was reached via and is thus backwards from how the caller of ruggrogue::find_path needs it. The links of the path need to be reversed so that each tile on the path points forwards and not backwards. The code looks like this: // Reverse the path from closest to start.
let mut current = came_from.get(&closest).copied();
let mut prev = closest; came_from.remove(&closest); while let Some(c) = current { let next = came_from.get(&c).copied(); came_from.insert(c, prev); prev = c; current = next;
} This is the same kind of logic used to reverse a linked list. If you're clever, you might be wondering why the ruggrogue::find_path function doesn't just reverse the start and destination positions to avoid having to manually reverse path data. Doing that would only save work if a path is definitely found between a monster and the player. If no path exists, the closest tile position is useless since it's only reachable from the destination and not the starting position; a second pathfinding run starting from the starting position would be needed anyway in that case.

