The a_star function lives just above the ruggrogue::find_path function in the src/lib/path_find.rs file; this is where the A* search algorithm is implemented in the game code. Its main job is to populate the came_from hash map passed into it with path data that hopefully connects the start and destination positions; to do this it needs some supporting data: // (priority, (x, y))
let mut frontier: BinaryHeap<(Reverse<i32>, (i32, i32))> = BinaryHeap::new();
// ((x, y), cost)
let mut cost_so_far: HashMap<(i32, i32), i32> = HashMap::new(); The frontier holds the set of tiles that the A* search algorithm will want to explore next; this is sometimes referred to as the open set . To minimize the number of explored tiles, tiles need to be popped out of the frontier based on how long the algorithm thinks the final path will be if it were to go through those tiles. Tiles therefore need to be popped out of the frontier in priority order: the BinaryHeap collection from Rust's standard library is perfect for this purpose. The data held in the frontier binary heap is a priority paired with a tile position. Rust's BinaryHeap type pops values out with highest numeric priority first, but we want the shortest path, not the longest, hence the Reverse<i32> type that reverses comparison order of numbers held within it. There's one more piece of data that needs to be remembered for each tile explored by the path finding algorithm: the path cost from the starting position to that tile. This is held in the cost_so_far hash map whose keys are tile positions and values are the distance from the starting position. As part of the A* search algorithm, the priority of a tile in the frontier is the sum of the distance so far and the estimated distance to the destination. This estimate is calculated using a heuristic function ; the one used by the a_star function looks like this: let dist100 = |(x1, y1), (x2, y2)| { let x_diff = if x1 < x2 { x2 - x1 } else { x1 - x2 }; let y_diff = if y1 < y2 { y2 - y1 } else { y1 - y2 }; let (low_diff, high_diff) = if x_diff < y_diff { (x_diff, y_diff) } else { (y_diff, x_diff) }; // Prefer axis-aligning with (x2, y2). low_diff * 141 + (high_diff - low_diff) * 99
}; This function calculates the approximate distance between two points, times 100 to avoid having to convert between integers and floating point values. This estimates the path cost where every diagonal step costs 141 (i.e. the square root of 2, multiplied by 100) and every cardinal step thereafter costs 100... Wait, why is there a multiplication by "99" and not "100"? To understand why this is, we need to go all the way back to monster AI. A monster will only pursue the player if they can see the player; if the monster loses sight of the player it will no longer give chase. If the player retreats down a corridor, a monster's best chance of keeping the player in its sights involves lining up with the player directly on either the horizontal or vertical axes. In other words, a monster wants to maximize the number of cardinal moves left in its path to the player while minimizing the number of diagonal moves left. By making cardinal moves cost 99 instead of 100 in the heuristic function, the monster's path will "hoard" cardinal steps by taking diagonal steps as early as possible. Take a moment to think through why this works: it definitely took me some time to wrap my head around at first. Just remember that dist100 is only a heuristic function; it doesn't actually affect the real path cost, just the priority of tiles explored in the frontier. There's another oddity about this heuristic function that, unlike the quirk above, is also reflected in the real path cost. Diagonal steps have an extra cost compared to cardinal moves in all of this pathfinding code, but steps in all eight directions cost a single turn during actual gameplay; why the discrepancy? Using Euclidean distance for pathfinding like this leads to paths that look more like what a human would choose. Using the exact distance calculations used by the gameplay instead leads to many intermediate frontier tiles with equal priority values, and the tie-breaking involved often leads to technically correct shortest paths that look ugly or bizarre. The big while loop in the a_star function performs the main part of the A* search algorithm: pop a tile from the frontier, terminate if it's the destination and add surrounding tiles to the frontier based on path cost priority. However, there's a little bit of extra tracking data: let mut closest = start;
let mut closest_cost = 0;
let mut closest_dist = dist100(start, dest); Each tile popped from the frontier is additionally checked to see if it's the closest to the destination. The big while loop updates this so that there's a fallback destination to take a path towards if the real destination cannot be reached.

