Roguelikes typically get their random numbers from what's called a pseudo-random number generator (or PRNG ). "Pseudo" means "fake", so a PRNG produces a deterministic series of numbers that just happen to look random enough for the purposes of a computer game. RuggRogue takes advantage of this determinism. Most roguelikes just initialize a single PRNG, hang onto it and share it across the whole game logic. RuggRogue instead creates temporary PRNGs whenever some code needs random numbers and discards those PRNGs afterwards. By carefully controlling how these PRNGs are initialized we can achieve seeded games , where two games with the same seed produce the same dungeon and spawns. Seeded games are useful for debugging and play-testing, and can be fun for players to mess around with. The nuts and bolts of generating random numbers is handled via external crates: rand , rand_xoshiro and wyhash . rand provides a convenient interface to make use of random numbers generated from a backend source crate. rand_xoshiro is a fast PRNG that provides the actual random numbers. wyhash is a hasher that takes input values and produces seed values to initialize PRNGs. These three crates serve as the foundation of all of the randomness in RuggRogue. A PRNG is initialized with a seed value that determines the sequence of random numbers that will be produced, so the first step in generating random numbers is to create this seed value. These seed values are created by combining the following input values using wyhash: A unique magic number. The game seed. Any other relevant differentiating input values. Each place in the code that needs random numbers starts by feeding a magic number into a wyhash hasher. Each magic number is an arbitrary number that is used in only one place in the code, the values of which can be found in the src/magicnum.rs file: ///! Arbitrary constants to seed hashers whose output is in turn used to seed RNGs. pub const GENERATE_ROOMS_AND_CORRIDORS: u64 = 0x3fdc77fb4d7f5d2f;
pub const SPAWN_GUARANTEED_WEAPON: u64 = 0x67caf3e7b16e9df2;
pub const SPAWN_GUARANTEED_ARMOR: u64 = 0x74e90549dbcadfd0;
pub const FILL_ROOM_WITH_SPAWNS: u64 = 0xd85af3d2cf6dcbc5;
pub const MELEE_ATTACK: u64 = 0x258890651a33d5d; Since there are five magic number constants, there are five unique places in the code where PRNGs are created. The fact that the magic numbers have different values helps to avoid the same seed being used by different PRNGs, which would otherwise produce the same random number sequence. The game seed is a unique number associated with a game that is the sole reason that different games have different dungeon layouts and outcomes. The initial game seed value can be provided as a command line argument or randomly generated as needed; this is one of the first things done in the main entry point function in the src/main.rs file. Starting a new game causes that game to adopt that initial value as that game's seed; this value is preserved across saves and loads. If the player returns to the title screen for whatever reason, the initial game seed value is changed into another random value to avoid accidentally playing the same dungeon again. With the magic number and game seed fed into the hasher, the final thing the hasher needs is some relevant differentiating input values. For example, the PRNG associated with GENERATE_ROOMS_AND_CORRIDORS provides the dungeon depth so that depth 2 has a different layout to depth 1. The final hash value is then used as the seed for that particular PRNG. Here's a code excerpt for GENERATE_ROOMS_AND_CORRIDORS from the src/map.rs file that demonstrates initializing a PRNG from hashed input values: use rand::SeedableRng;
use rand_xoshiro::Xoshiro128PlusPlus as GameRng;
use std::hash::Hasher;
use wyhash::WyHash; use crate::{magicnum, GameSeed}; pub fn generate_rooms_and_corridors(/* ... */) { // ... let mut rng = { let mut hasher = WyHash::with_seed(magicnum::GENERATE_ROOMS_AND_CORRIDORS); hasher.write_u64(game_seed.0); hasher.write_i32(map.depth); GameRng::seed_from_u64(hasher.finish()) }; // Use rng to get random numbers...
}

