In the course of testing, I noticed that there were differences between the native and web versions of the game with the presence and placement of monsters and items, given the same game seed. This meant that the same game seed was causing different random numbers to be produced by the same PRNG across the two builds! After a lot of debugging, I discovered that this was due to the native and web builds pulling out different amounts of data from the PRNGs. This divergence comes from pulling a usize from a PRNG; this is 64 bits on the x86_64 architecture of the native build, but only 32 bits on the wasm32 architecture of the web build. Replacing the usize with a u32 fixes the issue, but where this fix is needed can be pretty subtle. For example, can you spot the problem here? let num = rng.gen_range(1..2); for pos in room.iter_xy().choose_multiple(rng, num) { spawn_random_item_at(world, rng, pos);
} In the above code, the num variable is inferred by Rust to be of the usize type due to the lack of type annotations and the fact that it's the type of the second argument of the choose_multiple function. This causes rng.gen_range(1..2) to produce different values for the native and web versions of the game. Annotating the 1..2 input with an integer type of a fixed size resolves the issue: let num = rng.gen_range(1i32..2i32); for pos in room.iter_xy().choose_multiple(rng, num as usize) { spawn_random_item_at(world, rng, pos);
} The use of rng.gen_range(1i32..2i32) extracts a 32-bit i32 value on both the x86_64 and wasm32 architectures. Note that the num variable above is now also of type i32, so it needs to be cast into usize when being passed into the choose_multiple function.

