Before diving into the logic, it helps to be familiar with how the map is represented in terms of data. The main data structure involved is the Map struct that can be found in the src/map.rs file. The relevant parts of it are reproduced below: pub struct Map { pub depth: i32, pub width: i32, pub height: i32, tiles: Vec<Tile>, pub rooms: Vec<Rect>, // ...
} The depth field is the dungeon depth of the map; this is 1 for the first level. The width and height fields hold the dimensions of the map in terms of tiles. The tiles field contains the tiles themselves, stored in row-major order, i.e. store a full row of tiles, then the next row, then the next and so on. The Tile enum is defined higher up in the src/map.rs file: pub enum Tile { Floor, Wall, DownStairs,
} The final relevant field of the Map struct is the rooms field. This is a list of Rect structs, one for each room: pub struct Rect { pub x1: i32, pub y1: i32, pub x2: i32, pub y2: i32,
} Here, (x1, y1) is the top-left corner of the room, while (x2, y2) is the bottom-right corner. Even though rooms are drawn out as wall and floor tiles, the game needs to keep track of room positions like this in order to place other things in the level such as monsters and items later on, hence this list. A single Map struct is allocated and added as unique data at game launch in the main function in the src/main.rs file, like so: world.add_unique(Map::new(80, 50)); Every time a new level is needed, this Map struct is cleared and reused. There's no special reason for this except that it just happens to be the easiest way to do this for how unique game data is handled. Since this map is initialized here to be 80 tiles wide and 50 tiles high, all maps in the game share these dimensions.

