Once the rooms have been placed they need to be connected in a way that guarantees that all of the rooms can be reached. Rooms are connected with corridors as follows: Add the first room to a connected list and the rest to a disconnected list. While the disconnected list still has rooms: Pick the disconnected room that is closest to a room in the connected list. Join those rooms with a corridor drawn out of floor tiles. Move the room from the disconnected list to the connected list. Once every room is in the connected list, they can all be reached via corridors. The code itself looks like this: let mut connected: Vec<usize> = Vec::new();
let mut disconnected: Vec<usize> = Vec::new(); // Consider the first room as the start of connectedness.
connected.push(0); // All other rooms start disconnected.
for i in 1..map.rooms.len() { disconnected.push(i);
} // Connect all the disconnected rooms to the connected rooms based on closeness.
while !disconnected.is_empty() { // Find the closest match between connected and disconnected. let (closest_connected, closest_disconnected) = connected .iter() .enumerate() .flat_map(|c| std::iter::repeat(c).zip(disconnected.iter().enumerate())) .min_by_key(|&((_, &croom), (_, &droom))| { let ccenter = map.rooms[croom].center(); let dcenter = map.rooms[droom].center(); (ccenter.0 - dcenter.0).abs() + (ccenter.1 - dcenter.1).abs() }) .map(|((ci, _), (di, _))| (ci, di)) .unwrap(); // Connect the closest connected and disconnected rooms together. connect_rooms( &mut map, connected[closest_connected], disconnected[closest_disconnected], rng.gen::<bool>(), ); // Transfer newly-connected room index from disconnected to connected. connected.push(disconnected.remove(closest_disconnected));
} The connected and disconnected lists above store indices into the map's rooms list. The code for finding the closest disconnected room to a connected room can be a bit tricky to read. The connected/iter/enumerate/flat_map lines create an iterator that pairs up each connected room index with a disconnected room index. For example, if connected contains [0, 1] and disconnected contains [2, 3, 4], this iterator produces these pairs in order: (0, 2) (0, 3) (0, 4) (1, 2) (1, 3) (1, 4) The min_by_key code block calculates the approximate corridor length between the center tiles of the connected and disconnected rooms and returns the pair that would need the shortest corridor to connect. In the example above, if the (1, 3) pair had the shortest estimated corridor length, connected room 1 and disconnected room 3 would be joined with a corridor, and 3 would be moved from the disconnected list to the connected list. The task of drawing a corridor out of floor tiles is done by connect_rooms: let connect_rooms = |map: &mut UniqueViewMut<Map>, r1: usize, r2: usize, h_then_v: bool| { let (r1x, r1y) = map.rooms[r1].center(); let (r2x, r2y) = map.rooms[r2].center(); if h_then_v { map.set_hline(r2x, r1x, r2y, Tile::Floor); map.set_vline(r2y, r1y, r1x, Tile::Floor); } else { map.set_vline(r2y, r1y, r2x, Tile::Floor); map.set_hline(r2x, r1x, r1y, Tile::Floor); }
}; The h_then_v argument is a flag to draw horizontal floor tiles, then vertical floor tiles; this is decided with a random coin flip by the map generation random number generator. Corridors can freely overlap rooms and each other. Savvy readers may notice that joining rooms with corridors this way is like using Prim's algorithm for finding the minimum spanning tree of a graph, i.e. the least cost edges to join every node. A tree of a graph contains no loops, so what we have so far is a map with a lot of dead end rooms, which in gameplay terms means a lot of backtracking that we don't want. To reduce the number of dead ends and backtracking needed, several extra pairs of rooms are picked at random and joined with corridors as well.

