} If the value of the auto_run field here is None it means that auto-run is not happening and the game will wait on the player for input. On the other hand, a Some(...) value here means that auto-run is active, and the data within keeps track of the state of auto-running. The rest of the data structures relating to auto-run, as well as most of the logic, live in the src/player.rs file. The AutoRun struct is what's held in the aforementioned auto_run field, and appears as follows: pub struct AutoRun { limit: i32, dir: (i32, i32), run_type: AutoRunType,
} The limit field is the maximum number of steps that auto-run can proceed by itself, and exists mostly as a fail-safe against the possibility of any bugs that could cause infinite auto-running. The dir field holds the last direction that the player moved, which determines the direction that auto-running will proceed. This direction is interpreted as a (dx, dy) pair where the two values are one of -1, 0 or 1. The run_type field determines the type of auto-running that should occur; it's set when auto-run is requested and doesn't change. It holds one of the three values of the AutoRunType enum that looks like this: enum AutoRunType { RestInPlace, Corridor, Straight { expect_wall: AutoRunWallSide },
} These enum variants each correspond to the three types of auto-running that were described earlier. The AutoRunType::Straight variant holds extra data that it needs to remember that the other two AutoRunType variants don't need. This expect_wall field holds one of the variants of the AutoRunWallSide enum that looks like this: enum AutoRunWallSide { Neither, Left, Right,
} Straight auto-run keeps track of walls and open tiles to the left and right of the direction that the player is auto-running. AutoRunWallSide::Neither: Expect neither left nor right walls, i.e. both sides of the player should be fully open. AutoRunWallSide::Left: Expect a solid wall on the left and open space on the right. AutoRunWallSide::Right: Expect a solid wall on the right and open space on the left. Straight auto-run is stopped if the arrangement of tiles falls into a different category than expected, or doesn't fit into any of these categories.

