As mentioned above, a unique is some data stored in the world that isn't associated with an entity like a component would be. They're not technically required in an ECS, but many Rust ECS crates provide something like them as a convenience. For example, here's how RuggRogue stores the current game seed: pub struct GameSeed(u64); # let world = World::new();
let game_seed = std::env::args() .nth(1) .and_then(|arg| arg.as_str().parse().ok()) .unwrap_or_else(rand::random); world.add_unique(GameSeed(game_seed)); // <-- adding a unique to the world Since RuggRogue uses a single world to store all game data and passes it everywhere, uniques effectively act like global variables, without a lot of the incidental downsides of actual global variables. Unique data is accessed by requesting a UniqueView or UniqueViewMut borrow out of the world with World::borrow: // immutable borrow of GameSeed unique
let game_seed = world.borrow::<UniqueView<GameSeed>>();
println!("{:?}", game_seed.0); // mutable borrow of GameSeed unique
let game_seed = world.borrow::<UniqueViewMut<GameSeed>>();
game_seed.0 = 1234567890; There is no way to remove or directly replace a unique in Shipyard 0.4. The ability to remove uniques was only added in Shipyard 0.5, so RuggRogue hacks around this limitation when it needs to.

