An entity is a lightweight ID that's just a number in Shipyard's case. A component is some data associated with an entity. Each entity can have zero or one component of each type associated with it. Entities are created with a special borrow of EntitiesViewMut, like so: // creating a empty entity with no components
let mut entities = world.borrow::<EntitiesViewMut>(); let entity_id = entities.add_entity((), ()); Entities are often made starting out with component data that is modified using ViewMut: struct Position { x: i32, y: i32,
} struct Renderable { ch: char,
} let mut entities = world.borrow::<EntitiesViewMut>();
let mut positions = world.borrow::<ViewMut<Position>>();
let mut renderables = world.borrow::<ViewMut<Renderable>>(); // creating an entity with a Position component and a Renderable component
let entity_id = entities.add_entity( (&mut positions, &mut renderables), ( Position { x: 1, y: 2 }, Renderable { ch: '@' }, ),
); Deleting an entity requires clearing it out of every component storage, and thus requires the special AllStoragesViewMut borrow: let mut all_storages = world.borrow::<AllStoragesViewMut>(); all_storages.delete(entity_id_to_delete); Components can be added to entities after creation with an immutable EntitiesView borrow along with mutable ViewMut component borrows of the relevant storages: struct Name(String); struct GivesExperience(u64); let entities = world.borrow::<EntitiesView>();
let mut gives_experiences = world.borrow::<ViewMut<GivesExperience>>();
let mut names = world.borrow::<ViewMut<Name>>(); // adding Name and GivesExperience components to goblin_entity_id
entities.add_component( (&mut gives_experiences, &mut names), ( GivesExperience(20), Name("Goblin".to_string()), ), goblin_entity_id,
); Components can be deleted from an entity on demand with just a mutable ViewMut borrow on the relevant component storage: let mut names = world.borrow::<ViewMut<Name>>(); names.delete(entity_id_to_make_nameless); To check if an entity has a component, we can check if the View of the component storage contains the entity ID: struct Monster; // <-- empty tag struct if world.borrow::<View<Monster>>().contains(entity_id) { // entity_id has a Monster component
} A component can be checked for and accessed via a View or ViewMut as well using Rust's if let pattern matching syntax: struct CombatStats { hp: i32,
} let mut combat_stats = world.borrow::<ViewMut>(); if let Ok(combat_stats) = (&mut combat_stats).try_get(entity_id) { // entity_id has a CombatStats component, so do a bit of damage to it combat_stats.hp -= 1;
}

