A common operation in RuggRogue is to iterate over all entities that have a certain set of components on them. That can be achieved with the iter function of the Shipyard::IntoIter trait: use Shipyard::IntoIter; struct Name(String); struct Position { x: i32, y: i32,
} let names = world.borrow::<View<Name>>();
let positions = world.borrow::<View<Position>>(); // iterate over all entities that have both Name and Position components
for (name, pos) in (&names, &positions).iter() { println!("{} is at ({},{})", name.0, pos.x, pos.y);
} The entity IDs can be retrieved as well using the with_id function from Shipyard::Shiperator: use Shipyard::IntoIter;
use Shipyard::Shiperator; for (id, (name, pos)) in (&names, &positions).iter().with_id() { // do something with id, name and pos
} I believe Shipyard::IntoIter and Shipyard::Shiperator are no longer needed in Shipyard 0.5; consult its current documentation if you want to know more.

