Entities are uniquely identified by the Shipyard::EntityId type, which, as mentioned before, is just a number internally. Since it's so lightweight, we can use it to model relationships between different entities. For example, here's what equipping a player entity with weapon and armor entities might look like: struct Equipment { weapon: Option<EntityId>, armor: Option<EntityId>,
} struct AttackBonus(i32); struct DefenseBonus(i32); // create the player, weapon and armor entities
let (player_id, weapon_id, armor_id) = { let mut entities = world.borrow::<EntitiesViewMut>(); let mut attack_bonuses = world.borrow::<ViewMut<AttackBonus>>(); let mut defense_bonuses = world.borrow::<ViewMut<DefenseBonus>>(); let mut equipments = world.borrow::<ViewMut<Equipment>>(); // Equipment component for the player let player_id = entities.add_entity( &mut equipments, Equipment { weapon: None, armor: None, }, ); // AttackBonus component for the weapon let weapon_id = entities.add_entity(&mut attack_bonuses, AttackBonus(2)); // DefenseBonus component for the armor let armor_id = entities.add_entity(&mut defense_bonuses, DefenseBonus(1)); (player_id, weapon_id, armor_id)
}; // later on...
{ let mut equipments = world.borrow::<ViewMut<Equipment>>(); // equip the player if they have an Equipment component if let Ok(player_equip) = (&mut equipments).try_get(player_id) { // put the weapon and armor in the player's Equipment component player_equip.weapon = Some(weapon_id); player_equip.armor = Some(armor_id); }
} This pretty much covers all of the ways that RuggRogue uses Shipyard to handle its own game data.
